    /**
     * 初始化DynamicDataService
     * @param opts 额外参数
     * 
     * @memberof DynamicDataService
     */
    public constructor(opts: any = {}) {
        this.context = opts;
        this.registerAppMappingMap();
        this.registerAppViewMappingMap();
        this.registerAppCtrlMappingMap();
        this.registerAppCodeListMappingMap();
        this.registerAppEntityMappingMap();
        this.registerAppErrorMappingMap();
    }

    /**
     * 获取模型数据
     * 
     * @param path 动态路径
     * @param param 额外参数
     * 
     * @memberof DynamicDataService
     */
	public async getModelData(path: string, type: string, param: any) {
        let enableDynamic:boolean = AppServiceBase.getInstance().getAppEnvironment().bDynamic;
		path = enableDynamic ? path : this.computedTargetPath(type, path);
        if (!path && Object.is(type,"APP")){
            path = "./assets/json/app/app.json";
            enableDynamic = false;
        }
		if (this.dynamicCacheService.has(path)) {
			return this.dynamicCacheService.get(path);
		} else {
			let targetData: any;
			if (enableDynamic) {
				targetData = (await this.getRemoteModelData(path))['data'];
			} else {
				targetData = (await this.getLocalModelData(path))['data'];
			}
			this.dynamicCacheService.add(path, targetData);
			return targetData;
		}
	}

    /**
     * 获取远端模型数据
     * 
     * @param path 动态路径
     * @param enableDynamicMode 是否为动态模型(是则调用远端数据)
     * @param param 额外参数
     * 
     * @memberof DynamicDataService
     */
    public async getRemoteModelData(path: string) {
        const appEnvironment: any = AppServiceBase.getInstance().getAppEnvironment();
        let url: any = "";
        if (Object.is(appEnvironment.dynaMode, "RT")) {
            if (this.context && this.context.srfdynainstid) {
                url = `/net-disk/${appEnvironment.SysName}/${this.context.srfdynainstid}/${path}`;
            } else {
                const appStore: any = AppServiceBase.getInstance().getAppStore();
                let standDynaInstId: string = appStore.getters['authresource/getStandDynainstid'];
                url = `/net-disk/${appEnvironment.SysName}/${standDynaInstId}/${path}`;
            }
        } else {
            url = this.computedPath(this.context.srfdynainstid,path);
        }
        return this.http.get(url);
    }

    /**
     * 计算远端路径
     * 
     * @param path 路径
     * 
     * @memberof DynamicDataService
     */
    public computedPath(dynainstid:string,path:string):any{
        const appModelObj: any = AppServiceBase.getInstance().getAppModelDataObject();
        const appEnvironment: any = AppServiceBase.getInstance().getAppEnvironment();
        if(!dynainstid){
            return `${appEnvironment.remoteDynaPath}${path}`;
        }else{
            let dynainstParam:any = appModelObj.getPSDynaInsts.find((item:any) =>{
              return item.id === dynainstid;
            })
            return `${appEnvironment.remoteDynaPath2}${dynainstParam.instTag}/${dynainstParam.instTag2}/${path}`;
        }
    }

    /**
     * 获取本地模型数据
     * 
     * @param path 本地路径
     * 
     * @memberof DynamicDataService
     */
    public async getLocalModelData(path: string) {
        return await this.http.get(path);
    }

    /**
     * 计算本地目标路径
     * 
     * @param type 类型
     * @param path 动态路径
     * 
     * @memberof DynamicDataService
     */
    public computedTargetPath(type: string, path: string): any {
        switch (type) {
            case "APP":
                return this.appMappingMap.get(path);
            case "VIEW":
                return this.appViewMappingMap.get(path);
            case "CTRL":
                return this.appCtrlMappingMap.get(path);
            case "ENTITY":
                return this.appEntityMappingMap.get(path);
            case "CODELIST":
                return this.appCodeListMappingMap.get(path);
            case "ERROR":
                return this.appErrorMappingMap.get(path);
            default:
                return path;
        }
    }

